import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSun } from '@fortawesome/free-solid-svg-icons';

const Navbar = (props) => {
    return (
        <div className='flex flex-row'>
                <ul className='inline-flex'>
                    <li className=''>
                        <button className='' onClick={() => props.setActivePage('home')}>Home</button>
                    </li>
                    <li className=''>
                        <button className='' onClick={() => props.setActivePage('login')}>Login</button>
                    </li>
                    <li className=''>
                        <button className='' onClick={() => props.setActivePage('about')}>About us</button>
                    </li>
                    <li className=''>
                        <button className='' onClick={() => props.setActivePage('report waste')}>Report waste</button>
                    </li>
                    <li className=''>
                        <button className='' onClick={() => props.setActivePage('get discount')}>Marketplace</button>
                    </li>
                    <button className="relative right" onClick={props.handler}>
                        <FontAwesomeIcon icon={faSun} />
                    </button>
                </ul>
            </div>
    );
};

export default Navbar;
